 Для создания функции в Swift, которая сортирует массив целых чисел и выводит его на экран, можно использовать следующий код:

```swift
import Foundation

func sortAndPrintArray(of numbers: [Int]) {
    // Сортируем массив
    let sortedNumbers = numbers.sorted()

    // Выводим отсортированный массив на экран
    for number in sortedNumbers {
        print(number)
    }
}

// Пример использования функции
let unsortedNumbers = [5, 3, 8, 4, 2, 7, 1, 6]
sortAndPrintArray(of: unsortedNumbers)
```

Эта функция `sortAndPrintArray` принимает массив целых чисел `numbers` и сортирует его. После сортировки массива, функция перебирает его элементы и выводит каждый на экран.

 Para crear un código en ESP32 que muestre la dirección de los sensores de temperatura Dallas 18B20 y su temperatura en la consola serial, puedes utilizar el protocolo One-Wire para comunicarte con los sensores. Aquí te dejo un ejemplo básico de cómo podrías hacerlo:

1. **Configuración del ESP32:**
   Asegúrate de que el ESP32 esté configurado con el puerto serie y que el osciloscopio esté conectado a los pines de datos (DQ) del sensor para verificar la comunicación.

2. **Carga del Driver One-Wire:**
   Asegúrate de que el driver One-Wire esté incluido en tu proyecto. Si no lo tienes, puedes encontrarlo en la página oficial de Dallas o en repositorios de GitHub.

3. **Código del Programa:**

```cpp
#include "OneWire.h"
#include "DallasTemperature.h"

#define ONE_WIRE_BUS 21  // Reemplaza 21 con el número de pin que estés usando para el bus de uno-wire

OneWire oneWire(ONE_WIRE_BUS);  // Instancia del bus OneWire
DallasTemperature sensors(&oneWire);  // Instancia de DallasTemperature

void setup() {
  Serial.begin(115200);  // Inicializa el monitor serial
  sensors.begin();  // Inicializa el sensor DallasTemperature
}

void loop() {
  sensors.requestTemperatures();  // Solicita temperaturas a los sensores

  // Muestra las direcciones de los sensores y sus temperaturas
  for (int i = 0; i < sensors.getDeviceCount(); i++) {
    Serial.print("Address: ");
    Serial.print(sensors.getAddress(i), HEX);
    Serial.print(" Temperature: ");
    float tempC = sensors.getTempC(i);  // Obtiene la temperatura en Celsius
    Serial.println(tempC);
  }

  delay(3000);  // Espera 3 segundos antes de leer de nuevo
}
```

**Explicación del Código:**
- **OneWire y DallasTemperature:** Estas bibliotecas proporcionan la funcionalidad necesaria para comunicarse con los sensores Dallas 18B20.
- **Configuración del puerto:** Establecemos el puerto serie con `Serial.begin(115200)`.
- **Inicialización de DallasTemperature:** `sensors.begin();` inicia el sensor y busca automáticamente todos los sensores OneWire presentes en el bus.
- **Loop:** En cada iteración, `sensors.requestTemperatures();` solicita temperaturas a todos los sensores. Luego, se itera sobre los dispositivos y se imprimen las direcciones y las temperaturas en Celsius.
- **Tiempo de espera:** Se incluye un `delay(3000);` para que el programa no sea demasiado agresivo con el bus OneWire y permita a los otros dispositivos responder.

**Puntos a considerar:**
- Asegúrate de que los pines del ESP32 y los sensores estén correctamente conectados según tu placa.
- Verifica que el número de puerto serie (`ONE_WIRE_BUS`) esté correcto para tu configuración.
- El código asume que los sensores están disponibles en la dirección 0x28 (40 en decimal). Si tus sensores tienen direcciones diferentes, ajusta el código para corresponder.

Este código es un punto de partida y puede ser necesario ajustarlo para adaptarlo a tu configuración específica y asegurarte de que funciona correctamente en tu entorno.

 Claro, aquí tienes el algoritmo de ordenamiento por inserción implementado en C. Este algoritmo se conoce como "bubble sort" debido a la forma en que se despliega el proceso de ordenamiento.

```c
#include <stdio.h>

// Función para realizar el bubble sort
void bubbleSort(int arr[], int n) {
    int i, j;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            // Si el elemento actual es mayor que el siguiente, intercambian sus valores
            if (arr[j] > arr[j+1]) {
                int temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

// Función para imprimir el arreglo
void printArray(int arr[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

// Programa principal
int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Arreglo ordenado: \n");
    printArray(arr, n);
    return 0;
}
```

Este programa define una función `bubbleSort` que toma un arreglo de enteros y su tamaño como argumentos. La función itera sobre el arreglo y compara cada elemento con el siguiente. Si el elemento actual es mayor que el siguiente, los intercambia de lugar. Este proceso se repite hasta que el arreglo se ordene completamente.

La función `printArray` se utiliza para imprimir el arreglo ordenado en la consola.

El programa principal crea un arreglo de ejemplo, llama a `bubbleSort` para ordenar el arreglo y luego llama a `printArray` para mostrar el arreglo ordenado.

