 Claro, en Java, puedes crear un bucle `for` para repetir un bloque de código un número específico de veces o iterar sobre un rango de valores. Aquí te muestro cómo hacerlo:

```java
// Bucle for básico
for (int i = 0; i < 5; i++) {
    System.out.println("Iteración número " + i);
}
```

En este ejemplo, el bucle `for` itera 5 veces, comenzando desde 0 y aumentando el valor de `i` en 1 en cada iteración. La condición `i < 5` detiene el bucle después de 5 iteraciones.

También puedes utilizar un bucle `for` para iterar sobre un rango de valores, como un array o una colección, usando la sintaxis:

```java
// Bucle for con rango
int[] array = {1, 2, 3, 4, 5};
for (int j : array) {
    System.out.println("Valor en la posición " + j);
}
```

En este ejemplo, el bucle `for` itera sobre cada elemento del array `array` y asigna el valor actual de `j` al valor del elemento en cada iteración.

Puedes personalizar el bucle `for` para incluir una condición de finalización, como se muestra en el siguiente ejemplo:

```java
// Bucle for personalizado con condición de finalización
for (int k = 10; k >= 0; k--) {
    System.out.println("Cuenta regresiva: " + k);
}
```

En este ejemplo, el bucle `for` itera desde 10 hasta 0, disminuyendo el valor de `k` en 1 en cada iteración. La condición `k >= 0` detiene el bucle después de que `k` llegue a 0.

Estos son algunos ejemplos básicos de bucles `for` en Java. Puedes personalizarlos para satisfacer tus necesidades específicas de programación.
